import { Injectable } from '@angular/core';
import { Car } from './car.model';

@Injectable({
  providedIn: 'root'
})
export class DataService {
  cars: Car[] = [];

  constructor() {
    // Inicialize os carros aqui
  }

  getHistoricoDeletados(): Car[] {
    return this.cars.filter(car => car.deleted);
  }
}
